import React from 'react'
import {Link} from 'react-router-dom'
import '../Style'

function Menu() {
    return (
      <div className="menu_main">
          <p>This is a menu</p>
          <Link to="/">Home</Link>
          <Link to="/Login">Login</Link>
      </div>
    );
  }

  export default Menu;
